import React, { useState } from 'react';

function UseState() {
  
  const [flower, setFlower] = useState("rose");

  return (
    <div>
      <p>{flower}</p>
      <button onClick={() => setFlower(flower + flower)}>
        Click me
      </button>
    </div>
  );
}
export default UseState
